import React, { useState, useEffect } from 'react';

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("/workout/all")
      .then((res) => res.json())
      .then((data) => {
        setData(data);
        console.log(data);
      });
  }, []);

  return (
    <div>
      {data.length === 0 ? (
        <p>Loading...</p>
      ) : (
        data.map((workout, i) => (
          <div key={i}>
            <p>{workout.title}</p>
            //{/* You can display other workout properties here */}
          </div>
        ))
      )}
    </div>
  );
}

export default App;
